import React from 'react';
import ReactDOM from 'react-dom';
import { Map, GoogleApiWrapper } from 'google-maps-react';

class Maps extends React.Component {
  render() {
    return (
      <div>
        <p>Hello Google Maps</p>
        <Map google={this.props.google}/>
